    return(
        <div className="landing">
            <h1 className="titulo">Enjoy our Menu-Food</h1>
            <img className="imagenLanding" src="https://media.istockphoto.com/vectors/woman-cartoon-character-eating-vegetarian-food-flat-vector-isolated-vector-id1217944332" alt=""/>
            <h3 className="descripcion">
             We didn't want to change the foods you
             love, so we changed the way we make them.
